import { Col, Container, Row } from "react-bootstrap";

function Main(){
    return(
        <Container>
            <Row>
                <Col lg = "4" md = "6" sm = "12"></Col>
                <Col lg = "4" md = "6" sm = "12"></Col>
                <Col lg = "4" md = "6" sm = "12"></Col>
            </Row>
        </Container>
    )
}

export default Main
